                <input type="text" name="image"placeholder="image"/>
                <input type="text" name="description"placeholder="description"/>
                <input type="text" name="price"placeholder="description"/>
                <input type="submit"/>
                <h2>Post/Share Your Drone</h2>

            </form>
        );
    }
}
export default MyForm;
